"use strict";(self.webpackChunkwebsite=self.webpackChunkwebsite||[]).push([[4899],{86617:e=>{e.exports=JSON.parse('{"label":"Machine Learning","permalink":"/portfolio/docs/tags/machine-learning","allTagsPath":"/portfolio/docs/tags","count":11,"items":[{"id":"eda/data-balancing","title":"Data Balancing","description":"Welcome back to another thrilling ride on the data science rollercoaster. Today, we\u2019re diving headfirst into the wacky world of data balancing&mdash;a crucial skill in your machine learning toolkit. Picture this: you\u2019ve got a dataset that\u2019s as unbalanced as a seesaw with an elephant on one side and a feather on the other. Fear not! We\u2019re about to wield our coding wands and conjure up some enchanting solutions to slay the data imbalance dragon. \ud83d\udc09\ud83d\udd25","permalink":"/portfolio/docs/eda/data-balancing"},{"id":"eda/missing-data","title":"Dealing with Missing Data","description":"Welcome, fellow data enthusiasts and Python aficionados! Today, we embark on a thrilling journey to tackle one of the most common challenges in data science &mdash; missing data! Ah, those pesky gaps in our datasets that can ruin our models and give us headaches. But fear not! With Python as our trusty companion, we shall equip ourselves with the skills to handle missing data. So, fasten your seatbelts and let\u2019s dive in!","permalink":"/portfolio/docs/eda/missing-data"},{"id":"time-series/sktime","title":"Forecasting with sktime","description":"Greetings, data enthusiasts! Today, we embark on a thrilling journey into the realm of time-series forecasting using the marvelous sktime library. Whether you\u2019re a seasoned data scientist seeking to sharpen your skills or a curious beginner taking your first steps into the world of time-series analysis, this tutorial promises to unravel the magic behind forecasting with practicality. So, fasten your seatbelts and let\u2019s dive in!","permalink":"/portfolio/docs/time-series/sktime"},{"id":"anomaly-detection/fraud-detection","title":"Fraud Detection","description":"Welcome to this exciting journey into the world of credit card fraud detection using the power of machine learning and Python! In this article, I\u2019m going to walk you through the entire process of building a robust fraud detection model using the Keras library. Strap in as we explore each step, from data preprocessing to model evaluation, all while sprinkling in handy code examples and tips to make your learning experience smooth and enjoyable.","permalink":"/portfolio/docs/anomaly-detection/fraud-detection"},{"id":"computer-vision/ants-bees-classification","title":"Image Classification App","description":"tl;dr","permalink":"/portfolio/docs/computer-vision/ants-bees-classification"},{"id":"synthetic-data/intro","title":"Introduction","description":"Introduction","permalink":"/portfolio/docs/synthetic-data/intro"},{"id":"xai/intro","title":"Introduction to XAI","description":"What is Explainable AI?","permalink":"/portfolio/docs/xai/intro"},{"id":"hypertune/kerasTuner","title":"KerasTuner","description":"Hello, fellow data enthusiasts! Today, we\'re going to embark on an exciting journey through the world of hyperparameters in machine learning. If you\'re like me, you probably love the thrill of building a machine learning model and watching it learn and improve. But have you ever wondered how we can make our models even better? The secret sauce lies in the science of hyperparameter tuning.","permalink":"/portfolio/docs/hypertune/kerasTuner"},{"id":"misc/thresh-log-regr","title":"Logistic Regression Thresholds","description":"Hey there, data enthusiasts, Pythonistas, and machine learning mavens! Today, we\u2019re diving deep into the intriguing realm of logistic regression thresholds! Buckle up, as we embark on a fun-filled journey to find that elusive sweet spot where true magic happens! \ud83e\uddd9\u200d\u2642\ufe0f","permalink":"/portfolio/docs/misc/thresh-log-regr"},{"id":"stats/pvalue~0.05","title":"p-Value ~ 0.05","description":"Understanding p-value & the Significance Level","permalink":"/portfolio/docs/stats/pvalue~0.05"},{"id":"best-practices/reproducibility","title":"Reproducibility","description":"Welcome to another exciting journey into the world of data science. In this article, we will comprehensively explore the critical concept of reproducibility in data science projects. Reproducibility ensures that your data analysis and machine learning experiments can be duplicated by others, leading to more reliable and trustworthy results. Join me as we delve into the world of reproducibility and learn how to implement it effectively in your projects.","permalink":"/portfolio/docs/best-practices/reproducibility"}]}')}}]);